package mineField;

import javafx.application.Application;
import javafx.application.Platform;
import javafx.event.EventHandler;
import javafx.geometry.HPos;
import javafx.scene.Scene;
import javafx.scene.control.Label;
import javafx.scene.effect.ColorAdjust;
import javafx.scene.image.Image;
import javafx.scene.image.ImageView;
import javafx.scene.input.MouseButton;
import javafx.scene.input.MouseEvent;
import javafx.scene.layout.ColumnConstraints;
import javafx.scene.layout.GridPane;
import javafx.stage.Stage;

import java.io.ByteArrayInputStream;
import java.util.Base64;

public class Main extends Application {
    private static final String NEWGAME_ICON_BASE64 = "";
    private static final String TILE_ICON_BASE64 = "";
    private static final String EMPTY_TILE_ICON_BASE64 = "";
    private static final String BOMB_ICON_BASE64 = "";
    private static final String FLAG_ICON_BASE64 = "";
    private static final String TILE_1_ICON_BASE64 = "";
    private static final String TILE_2_ICON_BASE64 = "";
    private static final String TILE_3_ICON_BASE64 = "";
    private static final String TILE_4_ICON_BASE64 = "";
    private static final String TILE_5_ICON_BASE64 = "";
    private static final String TILE_6_ICON_BASE64 = "";
    private static final String TILE_7_ICON_BASE64 = "";
    private static final String TILE_8_ICON_BASE64 = "";

    private static final byte[] NEWGAME_ICON_BYTEARRAY = Base64.getDecoder().decode(NEWGAME_ICON_BASE64);
    private static final byte[] TILE_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_ICON_BASE64);
    private static final byte[] EMPTY_TILE_ICON_BYTEARRAY = Base64.getDecoder().decode(EMPTY_TILE_ICON_BASE64);
    private static final byte[] BOMB_ICON_BYTEARRAY = Base64.getDecoder().decode(BOMB_ICON_BASE64);
    private static final byte[] FLAG_ICON_BYTEARRAY = Base64.getDecoder().decode(FLAG_ICON_BASE64);
    private static final byte[] TILE_1_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_1_ICON_BASE64);
    private static final byte[] TILE_2_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_2_ICON_BASE64);
    private static final byte[] TILE_3_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_3_ICON_BASE64);
    private static final byte[] TILE_4_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_4_ICON_BASE64);
    private static final byte[] TILE_5_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_5_ICON_BASE64);
    private static final byte[] TILE_6_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_6_ICON_BASE64);
    private static final byte[] TILE_7_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_7_ICON_BASE64);
    private static final byte[] TILE_8_ICON_BYTEARRAY = Base64.getDecoder().decode(TILE_8_ICON_BASE64);

    private static Image newgameIcon;
    private static Image tileIcon;
    private static Image emptyTileIcon;
    private static Image bombIcon;
    private static Image flagIcon;
    private static Image tile1Icon;
    private static Image tile2Icon;
    private static Image tile3Icon;
    private static Image tile4Icon;
    private static Image tile5Icon;
    private static Image tile6Icon;
    private static Image tile7Icon;
    private static Image tile8Icon;

    private static final int TILE_SIDE = 50;
    private static final int DEFAULT_WIDTH = 10;
    private static final int DEFAULT_HEIGHT = 10;
    private static final int DEFAULT_BOMBS = 10;

    private boolean canShowAll;
    private boolean firstClick;
    private boolean gameOver;
    private Stage primaryStage;
    private GameManager gameManager;
    private GridPane externalGridPane;
    private GridPane topGridPane;
    private GridPane mineField;
    private Label timerLabel;
    private Label flagsLabel;
    private int clickPressX;
    private int clickPressY;
    private Timer timer;

    @Override
    public void start(Stage primaryStage) {
        this.primaryStage = primaryStage;
        initialize(true);
    }

    public void initialize (boolean first) {
        if (first) {
            primaryStage.setTitle("Mine Field");
            Thread.currentThread().setName("Mine Field");

            newgameIcon = new Image(new ByteArrayInputStream(NEWGAME_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE, true, true);
            tileIcon = new Image(new ByteArrayInputStream(TILE_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            emptyTileIcon = new Image(new ByteArrayInputStream(EMPTY_TILE_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            bombIcon = new Image(new ByteArrayInputStream(BOMB_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            flagIcon = new Image(new ByteArrayInputStream(FLAG_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile1Icon = new Image(new ByteArrayInputStream(TILE_1_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile2Icon = new Image(new ByteArrayInputStream(TILE_2_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile3Icon = new Image(new ByteArrayInputStream(TILE_3_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile4Icon = new Image(new ByteArrayInputStream(TILE_4_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile5Icon = new Image(new ByteArrayInputStream(TILE_5_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile6Icon = new Image(new ByteArrayInputStream(TILE_6_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile7Icon = new Image(new ByteArrayInputStream(TILE_7_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
            tile8Icon = new Image(new ByteArrayInputStream(TILE_8_ICON_BYTEARRAY), TILE_SIDE, TILE_SIDE,true,true);
        }

        if (timer != null) {
            timer.interrupt();
        }
        canShowAll = true;
        firstClick = true;
        gameOver = false;

        gameManager = new GameManager(this, DEFAULT_WIDTH, DEFAULT_HEIGHT, DEFAULT_BOMBS);
        gameManager.setName("Game Manager");
        gameManager.start();

        ImageView newGameImageView = new ImageView(newgameIcon);
        newGameImageView.setPreserveRatio(true);
        flagsLabel = new Label(String.valueOf(DEFAULT_BOMBS));
        timerLabel = new Label(String.valueOf(0));

        topGridPane = new GridPane();

        /* TODO: aggiungere a tutti i tile, con funzionalità di "annullare il clic", ed ottimizzare
            eventualmente sostituendo la classe ClickHandler */

        newGameImageView.addEventFilter(MouseEvent.MOUSE_PRESSED, event -> {
            ColorAdjust colorAdjust = new ColorAdjust();
            colorAdjust.setBrightness(-0.5);
            newGameImageView.setEffect(colorAdjust);
        });
        newGameImageView.addEventFilter(MouseEvent.MOUSE_RELEASED, event -> {
            newGameImageView.setEffect(null);
            initialize(false);
        });

        topGridPane.addRow(0, flagsLabel, newGameImageView, timerLabel);
        ColumnConstraints columnConstraints = new ColumnConstraints();
        columnConstraints.setPercentWidth(100);
        for (int i = 0; i < 3; i++) {
            topGridPane.getColumnConstraints().add(i, columnConstraints);
            GridPane.setHalignment(topGridPane.getChildren().get(i), HPos.CENTER);
        }

        externalGridPane = new GridPane();
        externalGridPane.add(topGridPane, 0, 0);

        mineField = new GridPane();

        for (int i = 0; i < DEFAULT_WIDTH; i++) {
            for (int j = 0; j < DEFAULT_HEIGHT; j++) {
                ImageView tile = new ImageView(tileIcon);
                tile.setPreserveRatio(true);
                mineField.add(tile, i, j,1,1);
            }
        }

        externalGridPane.add(mineField,0,1);
        topGridPane.setMinWidth(externalGridPane.getWidth());
        topGridPane.minHeight(externalGridPane.getHeight());

        Scene scene = new Scene(externalGridPane);

        mineField.setOnMousePressed(event -> {
            this.clickPressX = (int) event.getX();
            this.clickPressY = (int) event.getY();
        });
        mineField.setOnMouseReleased(new ClickHandler());

        primaryStage.setScene(scene);
        primaryStage.show();
        primaryStage.setMinWidth(externalGridPane.getWidth());
        primaryStage.setMinHeight(externalGridPane.getHeight());
        primaryStage.setResizable(false);
    }



    public static void main(String[] args) {
        launch(args);
    }

    public boolean isGameOver() {
        return gameOver;
    }

    private class ClickHandler implements EventHandler<MouseEvent> {

        @Override
        public void handle(MouseEvent event) {
            int x = (int) event.getX();
            int y = (int) event.getY();

            int dragDistanceX;
            int dragDistanceY;
            int maxDistance = TILE_SIDE;

            if (x > clickPressX) dragDistanceX = x - clickPressX;
            else dragDistanceX = clickPressX - x;

            if (y > clickPressY) dragDistanceY = y - clickPressX;
            else dragDistanceY = clickPressY - y;

            if (dragDistanceX >= maxDistance || dragDistanceY >= maxDistance) {
                clickPressX = -1;
                clickPressY = -1;
            } else {
                int i = x / TILE_SIDE;
                int j = y / TILE_SIDE;
//                boolean bomb = gameManager.isBomb(i, j);

                MouseButton mouseButton = event.getButton();

                if (gameManager.isFlag(i, j)) {
                    if (mouseButton.equals(MouseButton.SECONDARY)) {
                        updateCell(i, j, -2);
                    }
                } else if (!gameManager.isDiscovered(i, j)) {
                    if (mouseButton.equals(MouseButton.SECONDARY) && gameManager.canFlag()) {
                        updateCell(i, j, 9);
                    } else if (mouseButton.equals(MouseButton.PRIMARY)) {
                        updateCell(i, j, gameManager.discover(i, j));
                    }
                }
            }
        }
    }

    private void updateCell(int i, int j, int value) {
        if (firstClick) {
            firstClick = false;
            startTimer();
        }

        ImageView image;
        if (value == -1) {
            // bomb

            gameOver = true;
            image = new ImageView(bombIcon);
            mineField.setOnMouseReleased(event -> {});
            if (canShowAll) {
                showAll();
            }
        } else if (value == -2) {
            // was a flag, goes back to empty tile
            image = new ImageView(tileIcon);
            gameManager.updateFlag(i, j);
        } else if (value == 9) {
            // flag
            image = new ImageView(flagIcon);
            gameManager.updateFlag(i, j);
        } else {
            image = pickNumber(value);
        }

        mineField.add(image, i, j, 1, 1);
    }

    private void startTimer() {
        timer = new Timer(this);
    }

    public void updateTimerLabel() {
        String text = timerLabel.getText();
        final int n = Integer.parseInt(text) + 1;
        Platform.runLater(() -> timerLabel.setText(String.valueOf(n)));
    }

    private void showAll() {
        canShowAll = false;
        int width = gameManager.getWidth();
        int height = gameManager.getHeight();
        for (int i = 0; i < width; i++) {
            for (int j = 0; j < height; j++) {
                if (!gameManager.isDiscovered(i, j)) updateCell(i, j, gameManager.discover(i, j));
            }
        }
    }

    public void updateFlags(int flags) {
        flagsLabel.setText(String.valueOf(flags));
    }

    private ImageView pickNumber(int value) {
        switch (value) {
            case 0:
                return new ImageView(emptyTileIcon);
            case 1:
                return new ImageView(tile1Icon);
            case 2:
                return new ImageView(tile2Icon);
            case 3:
                return new ImageView(tile3Icon);
            case 4:
                return new ImageView(tile4Icon);
            case 5:
                return new ImageView(tile5Icon);
            case 6:
                return new ImageView(tile6Icon);
            case 7:
                return new ImageView(tile7Icon);
            case 8:
                return new ImageView(tile8Icon);
        }
        return null;
    }
}
